import random
from collections import deque

def row_strategy(history):
    if not history:
        return random.choice([0, 1])

    recent_history = deque(maxlen=5)
    for _, their_move in history[-5:]:
        recent_history.append(their_move)

    most_common_move = max(set(recent_history), key=recent_history.count, default=None)

    if most_common_move == 0:
        return 0
    elif most_common_move == 1:
        return 1
    else:
        return random.choice([0, 1])

